import React from "react";
import list from '../disney.jpg'

function home() {
    return (
        <div className="card">
  <img className="card-img-top" src={list} alt="Card image cap" />
  <div className="card-body">
    <h3 className="card-title">Disney Sports Basketball</h3>
    <p className="card-text">Rare Score(1-10): 11</p>
    <a href="#" className="btn btn-primary">View Listing</a>
    <a href="#" className="btn btn-warning">View Listing</a>
  </div>
</div>
    )
}

export default home
